/*Table structure for table `sh_goods` */

DROP TABLE IF EXISTS `sh_goods`;

CREATE TABLE `sh_goods` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `name` varchar(120) DEFAULT NULL COMMENT '名字',
  `goods_sn` varchar(60) DEFAULT NULL COMMENT '商品序列号',
  `category_id` bigint(20) DEFAULT NULL COMMENT '商品所属分类',
  `brand_id` int(11) DEFAULT NULL COMMENT '品牌id',
  `is_on_sale` int(11) DEFAULT '1' COMMENT '是否上架',
  `is_delete` int(11) DEFAULT '0' COMMENT '是否下架',
  `is_on_spec` int(11) DEFAULT '0' COMMENT '是否启用商品规格',
  `is_new` int(11) DEFAULT '0' COMMENT '是否新品',
  `is_limited` int(11) DEFAULT '0' COMMENT '是否限购',
  `is_hot` int(11) DEFAULT '0' COMMENT '是否热卖',
  `is_show_stock` int(11) DEFAULT '1' COMMENT '是否显示库存',
  `is_show_sell_volume` int(11) DEFAULT '1' COMMENT '是否显示销量',
  `retail_price` decimal(19,2) DEFAULT NULL COMMENT '零售价格',
  `market_price` decimal(19,2) DEFAULT NULL COMMENT '市场价',
  `primary_pic_url` varchar(255) DEFAULT NULL COMMENT '商品图片',
  `sort_order` int(11) DEFAULT NULL COMMENT '排序',
  `sell_volume` int(11) DEFAULT NULL COMMENT '销量',
  `type_pay` int(11) DEFAULT NULL COMMENT '支付类型(01:货到付款;02：微信支付;03：会员卡支付)',
  `type_reduce_stock` int(11) DEFAULT NULL COMMENT '减库存方式',
  `goods_desc` text COMMENT '商品描述',
  `stock_number` int(11) DEFAULT NULL COMMENT '库存',
  `goods_brief` varchar(255) DEFAULT NULL COMMENT '商品简述',
  `list_pic_url` varchar(2000) DEFAULT NULL COMMENT '商品列表图',
  `appid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKrvjgdpin35anr16fvurm4kxwa` (`category_id`),
  CONSTRAINT `FKrvjgdpin35anr16fvurm4kxwa` FOREIGN KEY (`category_id`) REFERENCES `sh_goods_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=177 DEFAULT CHARSET=utf8mb4 COMMENT='商品信息';

