/*Table structure for table `sh_goods_category` */

DROP TABLE IF EXISTS `sh_goods_category`;

CREATE TABLE `sh_goods_category` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `name` varchar(90) DEFAULT NULL COMMENT '名字',
  `front_name` varchar(255) DEFAULT NULL COMMENT '前端名字',
  `front_desc` varchar(255) DEFAULT NULL COMMENT '前段名字描述',
  `level` varchar(255) DEFAULT NULL COMMENT '级别',
  `type` int(11) DEFAULT NULL COMMENT '类型(1:衣;2:食;3住;4:行)',
  `show_index` int(11) DEFAULT NULL COMMENT '首页展示排序',
  `is_show` int(11) DEFAULT NULL COMMENT '是否显示',
  `keywords` varchar(255) DEFAULT NULL COMMENT '关键字',
  `parent_id` bigint(11) DEFAULT NULL COMMENT '上级类型id',
  `sort_order` int(11) DEFAULT NULL COMMENT '排序',
  `banner_url` varchar(255) DEFAULT NULL COMMENT 'banner图片链接',
  `icon_url` varchar(255) DEFAULT NULL COMMENT 'icon图片链接',
  `img_url` varchar(255) DEFAULT NULL COMMENT 'img图片链接',
  `wap_banner_url` varchar(255) DEFAULT NULL COMMENT 'wap端banner图片链接',
  `appid` varchar(255) DEFAULT NULL,
  `is_show_channel` int(11) DEFAULT NULL COMMENT '是否显示在首页频道',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8mb4 COMMENT='导航';

