/*Table structure for table `sh_goods_specification` */

DROP TABLE IF EXISTS `sh_goods_specification`;

CREATE TABLE `sh_goods_specification` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `appid` varchar(36) NOT NULL,
  `goods_id` bigint(20) DEFAULT NULL COMMENT '商品ID',
  `specification_id` bigint(20) DEFAULT NULL COMMENT '规格ID',
  `value` varchar(255) DEFAULT NULL COMMENT '规格值',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=278 DEFAULT CHARSET=utf8mb4 COMMENT='商品规格';

