/*Table structure for table `sh_keywords` */

DROP TABLE IF EXISTS `sh_keywords`;

CREATE TABLE `sh_keywords` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `keyword` varchar(90) DEFAULT NULL COMMENT '关键字',
  `scheme_url` varchar(255) DEFAULT NULL COMMENT '关键词的跳转链接',
  `is_hot` int(11) DEFAULT NULL COMMENT '热销',
  `is_default` int(11) DEFAULT NULL COMMENT '默认',
  `is_show` int(11) DEFAULT NULL COMMENT '显示',
  `sort_order` int(11) DEFAULT NULL COMMENT '排序',
  `type` int(11) DEFAULT NULL COMMENT '类型',
  `appid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='关键字';

/*Data for the table `sh_keywords` */

/*Table structure for table `sh_order` */

DROP TABLE IF EXISTS `sh_order`;

CREATE TABLE `sh_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `user_id` int(11) DEFAULT NULL COMMENT '收货人用户id',
  `goods_name` varchar(60) DEFAULT NULL COMMENT '商品标题',
  `order_status` varchar(11) DEFAULT NULL COMMENT '订单状态',
  `order_type` varchar(11) DEFAULT NULL COMMENT '订单类型(SELF:普通订单;SELF:自提订单)',
  `discount_type` int(11) DEFAULT NULL COMMENT '优惠类型(01:首单优惠;02:减运费;03:使用卡券;04:积分减免)',
  `consignee` varchar(60) DEFAULT NULL COMMENT '收货人',
  `country` varchar(50) DEFAULT NULL COMMENT '国家',
  `province` varchar(50) DEFAULT NULL COMMENT '省',
  `city` varchar(50) DEFAULT NULL COMMENT '市',
  `area` varchar(50) DEFAULT NULL COMMENT '区',
  `address` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `mobile` varchar(60) DEFAULT NULL COMMENT '收货人电话',
  `postscript` varchar(255) DEFAULT NULL COMMENT '买家留言',
  `pay_status` varchar(11) DEFAULT NULL COMMENT '支付状态',
  `shipping_name` varchar(120) DEFAULT NULL COMMENT '快递公司名字',
  `shipping_no` varchar(32) DEFAULT NULL COMMENT '快递编号',
  `shipping_status` varchar(11) DEFAULT NULL COMMENT '快递状态',
  `freight` decimal(19,2) DEFAULT NULL COMMENT '快递费',
  `actual_price` decimal(19,2) DEFAULT NULL COMMENT '实际需要支付的金额',
  `integral` int(11) DEFAULT NULL COMMENT '积分',
  `integral_money` decimal(19,2) DEFAULT NULL COMMENT '积分抵扣金额',
  `order_price` decimal(19,2) DEFAULT NULL COMMENT '订单总价(商品总价+快递费-优惠-折扣等)',
  `goods_price` decimal(19,2) DEFAULT NULL COMMENT '商品总价',
  `add_time` datetime DEFAULT NULL COMMENT '订单添加时间',
  `confirm_time` datetime DEFAULT NULL COMMENT '订单确认时间',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `shipping_time` datetime DEFAULT NULL COMMENT '发货时间',
  `finish_time` datetime DEFAULT NULL COMMENT '完成时间',
  `refund_time` decimal(19,2) DEFAULT NULL COMMENT '退款时间',
  `freight_price` decimal(19,2) DEFAULT NULL COMMENT '配送价格',
  `coupon_id` bigint(20) DEFAULT NULL COMMENT '使用的优惠券id',
  `coupon_price` decimal(19,2) DEFAULT NULL COMMENT '优惠券价格',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '上级订单id',
  `full_cut_price` decimal(19,2) DEFAULT NULL COMMENT '满减价格',
  `order_number` varchar(36) DEFAULT NULL COMMENT '订单编码',
  `appid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=109 DEFAULT CHARSET=utf8mb4 COMMENT='订单信息';

/*Data for the table `sh_order` */

