/*Table structure for table `sh_order_goods` */

DROP TABLE IF EXISTS `sh_order_goods`;

CREATE TABLE `sh_order_goods` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单Id',
  `goods_id` bigint(20) DEFAULT NULL COMMENT '商品id',
  `product_id` bigint(20) DEFAULT NULL COMMENT '产品Id',
  `number` int(11) DEFAULT NULL COMMENT '商品数量',
  `market_price` decimal(19,2) DEFAULT NULL COMMENT '市场价',
  `retail_price` decimal(19,2) DEFAULT NULL COMMENT '零售价格',
  `is_real` int(11) DEFAULT NULL COMMENT '虚拟商品',
  `appid` varchar(255) DEFAULT NULL,
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `thumbnail_url` varchar(255) DEFAULT NULL COMMENT '缩略图',
  `spec_value` varchar(255) DEFAULT NULL COMMENT '规格名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=115 DEFAULT CHARSET=utf8mb4 COMMENT='订单商品关系';

