  `user_name` varchar(255) DEFAULT NULL COMMENT '操作者',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单id',
  `appid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=234 DEFAULT CHARSET=utf8mb4 COMMENT='订单日志';

