/*Table structure for table `sh_order_pay` */

DROP TABLE IF EXISTS `sh_order_pay`;

CREATE TABLE `sh_order_pay` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单编号',
  `pay_type` varchar(20) DEFAULT NULL COMMENT '支付类型',
  `pay_number` varchar(64) DEFAULT NULL COMMENT '支付单单号',
  `pay_balance` decimal(19,2) DEFAULT NULL COMMENT '支付金额',
  `status` int(11) DEFAULT NULL COMMENT '状态',
  `third_pay_id` varchar(255) DEFAULT NULL COMMENT '第三方支付单号(微信)',
  `add_data` varchar(255) DEFAULT NULL COMMENT '附加数据',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `gateway_res_code` varchar(255) DEFAULT NULL COMMENT '网关响应吗',
  `gateway_res_body` varchar(255) DEFAULT NULL COMMENT '网关响应体',
  `appid` varchar(255) DEFAULT NULL,
  `prepay_id` varchar(200) DEFAULT NULL COMMENT '预支付ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8mb4 COMMENT='订单支付信息';

