/*Table structure for table `sh_order_return` */

DROP TABLE IF EXISTS `sh_order_return`;

CREATE TABLE `sh_order_return` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `optlock` bigint(20) DEFAULT '1',
  `return_type` int(11) DEFAULT NULL COMMENT '退货类型',
  `number` varchar(200) DEFAULT NULL COMMENT '退货退款单号',
