  `operator` varchar(200) DEFAULT NULL COMMENT '操作人',
  `check_comment` varchar(1020) DEFAULT NULL COMMENT '审核意见',
  `tracking` varchar(200) DEFAULT NULL COMMENT '快递单号',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `express_crop` varchar(200) DEFAULT NULL COMMENT '物流公司',
  `express_desc` varchar(200) DEFAULT NULL COMMENT '物流发货备注',
  `user_id` bigint(20) DEFAULT NULL COMMENT '所属用户',
  `appid` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8mb4 COMMENT='订单退款';

