/*Table structure for table `sh_product` */

DROP TABLE IF EXISTS `sh_product`;

CREATE TABLE `sh_product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `stock_number` int(11) DEFAULT NULL COMMENT '库存量',
  `market_price` decimal(19,2) DEFAULT NULL COMMENT '市场价',
  `retail_price` decimal(19,2) DEFAULT NULL COMMENT '零售价',
  `product_model` varchar(60) DEFAULT NULL COMMENT '产品型号',
  `goods_id` bigint(20) DEFAULT NULL COMMENT '商品id',
  `appid` varchar(255) DEFAULT NULL,
  `spec_key` varchar(255) DEFAULT NULL COMMENT '规格id',
  `thumbnail_url` varchar(255) DEFAULT NULL COMMENT '产品图片',
  `spec_value` varchar(2000) DEFAULT NULL COMMENT '规格值',
  `is_default` int(1) DEFAULT '0' COMMENT '是否默认',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=332 DEFAULT CHARSET=utf8mb4 COMMENT='产品表';

