/*Table structure for table `sh_search_history` */

DROP TABLE IF EXISTS `sh_search_history`;

CREATE TABLE `sh_search_history` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `from` varchar(45) DEFAULT NULL COMMENT '搜索来源，如PC、小程序、APP等',
  `user_id` bigint(20) DEFAULT NULL COMMENT '会员Id',
  `keyword` varchar(255) DEFAULT NULL COMMENT '关键字',
  `add_time` int(11) DEFAULT NULL COMMENT '搜索时间',
  `appid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='搜索历史';

