/*Table structure for table `sh_topic` */

DROP TABLE IF EXISTS `sh_topic`;

CREATE TABLE `sh_topic` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `title` varchar(255) DEFAULT NULL COMMENT '活动主题',
  `avatar` varchar(255) DEFAULT NULL COMMENT '化名',
  `item_pic_url` varchar(255) DEFAULT NULL COMMENT '活动条例图片',
  `subtitle` varchar(255) DEFAULT NULL COMMENT '子标题',
  `read_count` varchar(255) DEFAULT '0' COMMENT '阅读量',
  `scene_pic_url` varchar(255) DEFAULT NULL COMMENT '场景图片链接',
  `content` text COMMENT '活动内容',
  `price_info` decimal(19,2) DEFAULT NULL COMMENT '活动价格',
  `appid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8mb4 COMMENT='活动';

