r/></p>','1.00','d8f0329e3e2844aebf6ef06f6dc42e57'),(23,'2018-12-17 17:09:11',1,'2018-12-17 17:28:11','冬令营--雏鹰计划',NULL,'http://image.enfunly.com/upload/shtopic/201812171545037691666_5495.jpg','我是小小特种兵','1000','http://image.enfunly.com/upload/shtopic/201812171545037704212_5968.jpg','<p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 20px;\">每到放长假时，家长最头大的事情就来了：</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 20px; color: rgb(255, 0, 0);\">孩子每天玩手机；打游戏，看电视剧</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 20px; color: rgb(0, 176, 80);\">是的每个孩子都一样的，不比过去的小朋友，玩泥巴都能玩出不同的花样来！</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 20px; color: rgb(192, 0, 0);\">这只能说社会的进步，切忘了孩子们童真的世界，造成孩子们的生活范围越来越小。</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 20px; color: rgb(31, 73, 125);\">为此，我们专门为孩子们策划了一套能玩，又能交朋友，重点是还能学到课堂上所学不到的冬令营之我是特战队的产品</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 20px; color: rgb(31, 73, 125);\">我们先来回顾今年的夏令营----雏鹰特训营</span></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037973562082837.jpg\" title=\"8315497461036372\"/><br/></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037974256016701.jpg\" title=\"11511199355249369\" alt=\"微信图片_20181210113427_副本.jpg\"/></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037975096025296.jpg\" title=\"377184226788986\"/></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037975537084872.jpg\" title=\"4833221438952002\" alt=\"微信图片_20181217140617.jpg\"/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037976428085477.jpg\" title=\"8906699060527697\"/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545038045955080921.jpg\" title=\"18710925161249859\" alt=\"微信图片_20181211153303.jpg\"/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0);\">是不是很帅，当然这只是看到的表面，</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0);\">重点的是他们确实变的懂事了！</span></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037978777087653.jpg\" title=\"19739239630175564\" alt=\"initpintu_副本.jpg\"/></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(112, 48, 160);\">曾是衣来伸手饭来张口的一个宝，如今把劳动当成是光荣的责任，</span></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal; text-align: center;\"><span style=\"color: rgb(255, 0, 0); font-size: 24px;\">酷出有型，重点的是他们确实变的懂事了！</span><br/></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037979783051628.jpg\" title=\"7640156352341856\" alt=\"微信图片_20181217161856.jpg\"/></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037980082044145.jpg\" title=\"31189100877791097\" alt=\"微信图片_20181217161900.jpg\"/></span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px;\">我们再往下回忆：他们不是在做秀，</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px;\">几天的时间他们成为合格的小战士，不再是你心目中长不大的娃！</span></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037980813002756.jpg\" title=\"34318863805853825\" alt=\"initpintu_副本.jpg\"/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px;\">再看结营一的幕</span></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037981619061099.jpg\" title=\"4620475557782711\" alt=\"微信图片_20181217142027.jpg\"/></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037983179060445.jpg\" title=\"18851693025923444\" alt=\"微信图片_20181217142022.jpg\"/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal; text-align: center;\"><span style=\"color: rgb(0, 112, 192); font-size: 24px;\">几天下来。他们早成为了“同生共死”的战友，学校能给他们培养这样的情感吗？</span></p><p style=\"white-space: normal; text-align: center;\"><img src=\"http://image.enfunly.com/upload/ueditor/image/20181217/1545037984469089995.png\" title=\"16293808099997354\" alt=\"未命名.png\"/><video class=\"edui-upload-video  vjs-default-skin      video-js\" controls=\"\" preload=\"none\" width=\"420\" height=\"280\" src data-setup=\"{}\"></video></p><p style=\"white-space: normal;\"><span style=\"font-size: 24px;\">不舍之情源于：对战友不舍；对生活过的营房不舍，对教官的不舍</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0);\">这就是成长，这是就他们天性！</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(0, 176, 80);\">放飞孩子的心灵，归属他们的童年</span>！</p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 36px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">雏鹰计划三日营</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\"><br/></span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(0, 112, 192); background-color: rgb(255, 255, 255);\">全营区监控覆盖，家长可随时打开看到自己孩子成长过程</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(255, 255, 255);\"><br/></span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; background-color: rgb(146, 208, 80);\">日常训练：</span><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\"><br/></span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">队列；跑步；体能；灾害自救常识；遇敌自救，</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\"><br/></span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; background-color: rgb(146, 208, 80);\">手工配套：</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">超级战士</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">我是小花农</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">森林考古（恐龙化石）</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">昆虫；植物标本</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\"><br/></span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; background-color: rgb(146, 208, 80);\">生活配套：</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">垂钓</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">篝火晚会；</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">烧烤</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">VCR录制（我是主角）</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\"><br/></span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; background-color: rgb(146, 208, 80);\">结营：</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">风雨人生路（家长；队员共同参加）</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">颂奖</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">开营日期</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(255, 0, 0); background-color: rgb(146, 208, 80);\">2019年元月24日--26日</span></p><p style=\"white-space: normal; text-align: center;\"><span style=\"font-size: 24px; color: rgb(25