  `birthday` datetime DEFAULT NULL COMMENT '用户生日',
  `last_login_time` datetime DEFAULT NULL COMMENT '上次登录时间',
  `user_level_id` bigint(20) DEFAULT '1' COMMENT '所属用户组(01:默认;02：待定)',
