/*Table structure for table `sh_user_level` */

DROP TABLE IF EXISTS `sh_user_level`;

CREATE TABLE `sh_user_level` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `optlock` bigint(20) NOT NULL DEFAULT '1' COMMENT '乐观锁',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `level_name` varchar(255) DEFAULT NULL COMMENT '会员等级名称',
  `discount` decimal(19,2) DEFAULT NULL COMMENT '折扣',
  `level_type` int(11) DEFAULT NULL COMMENT '等级类型',
  `need_consumer_amt` decimal(19,2) DEFAULT NULL COMMENT '所需消费金额',
  `user_number` int(11) DEFAULT NULL COMMENT '会员数',
  `level_change_type` int(11) DEFAULT NULL COMMENT '会员等级变更方式(01:通过管理员;02:根据消费金额升降;03:根据消费金额只升不降)',
  `appid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='会员等级';

/*Data for the table `sh_user_level` */

/*Table structure for table `sys_captcha` */

DROP TABLE IF EXISTS `sys_captcha`;

CREATE TABLE `sys_captcha` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `uuid` char(36) NOT NULL COMMENT 'uuid',
  `code` varchar(6) NOT NULL COMMENT '验证码',
  `expire_time` datetime DEFAULT NULL COMMENT '过期时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `optlock` int(10) DEFAULT '0' COMMENT '乐观锁',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=297 DEFAULT CHARSET=utf8 COMMENT='系统验证码';

